import React from "react";
import { useNavigate } from "react-router-dom";
// import { IoPerson, IoAlbums, IoHome, IoLogOut } from "react-icons/io5";
import { useDispatch, /*useSelector*/ } from "react-redux";
import { LogOut, reset } from "../features/authSlice";
import { Container, Navbar, Nav, NavDropdown} from "react-bootstrap";
import logo from "../bps.png";

const NavB = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  // const { user } = useSelector((state) => state.auth);

  const logout = () => {
    dispatch(LogOut());
    dispatch(reset());
    navigate("/");
  };

  return (
    <Navbar collapseOnSelect expand="lg" bg="white" variant="white">
    <Container>
      <Navbar.Brand href="/dashboard">
      <img
              alt=""
              src={logo}
              height="50"
              className="d-inline-block align-top"/>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="me-auto">
        </Nav>
        <Nav>
          <Nav.Link href="/users">Pegawai</Nav.Link>
          <Nav.Link href="/izin">Izin</Nav.Link>
          <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
            <NavDropdown.Item href="#action/3.1" onClick={logout}>
            Logout
            </NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
  )
};

export default NavB;
